            <div className={classes.root}>
            <GridList cellHeight={400} className={classes.gridList} cols={1}>
              {entries.map((tile) => (
                <GridListTile key={tile.link} cols={tile.cols || 1}>
                  <img src={tile.link} alt={tile.name} />
                </GridListTile>
              ))}
            </GridList>
          </div>
          );
}
export default Pictures;
